import React from "react";
import NavBar from "./NavBar";
import Banner from "./Banner";
import { Box, Typography, Badge, Button, styled } from "@mui/material";
const SearchIconWrapper = styled(Box)`
  margin-left: auto;
  padding: 5px;
  display: flex;
  color: blue;
`;

function Home(props) {
  return (
    <>
      <NavBar />
   <Box>
   <Banner />
   </Box>
      
    </>
  );
}

export default Home;
